(2088, 4, 74, 0, 610285, 'Maybe he has a little friend that lives right over here. I really believe that if you practice enough you could paint the \'Mona Lisa\' with a two-inch brush. Painting should do one thing. It should put happiness in your heart. Trees cover up a multitude of sins. Don\'t fight it, use what happens. What the devil.'),
(2089, 4, 73, 0, 610285, 'Maybe he has a little friend that lives right over here. I really believe that if you practice enough you could paint the \'Mona Lisa\' with a two-inch brush. Painting should do one thing. It should put happiness in your heart. Trees cover up a multitude of sins. Don\'t fight it, use what happens. What the devil.\r\n\r\nThere it is. That\'s the way I look when I get home late; black and blue. A little happy sunlight shining through there.\r\n\r\nMix your color marbly don\'t mix it dead. Everyone needs a friend. Friends are the most valuable things in the world. This piece of canvas is your world. Just use the old one inch brush. How to paint. That\'s easy. What to paint. That\'s much harder. That\'s what makes life fun. That you can make these decisions. That you can create the world that you want.'),
