(2, 'Footer Links Company', 'footer_links_company', '<div class=\"title-block text-center\">\r\n<h2><span>INSTAGRAM</span></h2>\r\n<p class=\"h4\">Follow us</p>\r\n</div>', '2018-05-10 00:26:20', '2018-07-18 22:57:04', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2018-05-10 00:26:20', '2018-05-10 00:26:20', 1),
(4, 'Organie Block Title New Products', 'organie_block_title_new_products', '<div class=\"title-block text-center\">\n<h2>New products</h2>\n<p class=\"h4\">Featured products</p>\n</div>', '2018-07-06 13:16:21', '2018-07-06 13:16:21', 1),
(5, 'Organie Block Free Shipping Center', 'organie_free_shipping_center', '<div class=\"block-services\"><a href=\"#\"><img src=\"{{media url=\"wysiwyg/home/bg-freeshiping.png\"}}\" alt=\"\" /></a>\n<div class=\"box-text\">\n<h4>Free Shipping</h4>\n<p class=\"h5\">All order over $100</p>\n</div>\n</div>', '2018-07-06 13:16:21', '2018-07-06 13:16:21', 1),
(6, 'Organie Block Support Center', 'organie_support_center', '<div class=\"block-services\"><a href=\"#\"><img src=\"{{media url=\"wysiwyg/home/bg-support.png\"}}\" alt=\"\" /></a>\n<div class=\"box-text\">\n<h4>Support customer</h4>\n<p class=\"h5\">Support 24/7</p>\n</div>\n</div>', '2018-07-06 13:16:22', '2018-07-06 13:16:22', 1),
(7, 'Organie Block Made Width Love', 'organie_made_width_love', '<div class=\"block-services\"><a href=\"#\"><img src=\"{{media url=\"wysiwyg/home/bg-bestservices.png\"}}\" alt=\"\" /></a>\n<div class=\"box-text\">\n<h4>Made With Love</h4>\n<p class=\"h5\">Best Services</p>\n</div>\n</div>', '2018-07-06 13:16:22', '2018-07-06 13:16:22', 1),
(8, 'Ogranie Block Life Left', 'organie_block_life_left', '<div class=\"organie3-block-life icon-left\">\n<div class=\"block-fresh item-block\"><i class=\"farm icon-lettuce\">&nbsp;</i>\n<div class=\"content-text\">\n<h3>Always Fresh</h3>\n<p>Cur tantas regiones barbarorum peat dibus obiit, tot mariata uisque euismod convallis eros quis lacinia</p>\n</div>\n</div>\n<div class=\"block-fresh item-block\"><i class=\"farm icon-lemon\">&nbsp;</i>\n<div class=\"content-text\">\n<h3>Keep You Healthy</h3>\n<p>Uisque euismod convallis eros quis lacinia enim rhoncu ur tantas regiones barbarorum peat dibus obiit</p>\n</div>\n</div>\n<div class=\"block-fresh item-block\"><i class=\"farm icon-cucumber\">&nbsp;</i>\n<div class=\"content-text\">\n<h3>Healthy Cooking</h3>\nConsectetur adipisicing elitur tantas regiones barbarorum peat dibus obiit, tot mariataelitur</div>\n</div>\n</div>', '2018-07-06 13:16:22', '2018-07-06 13:16:22', 1),
