fter Care Funeral Services, Bastian and Perrott, Oswald Mortuary, Crawford Mortuary Northridge Dignity Memorial, Kiefer &amp; Eyerick Mortuary, Sci, Rucker\'s Mortuary, Eden Memorial Park, Mission Hills Catholic Mortuary, Ampak Group, Fly By Wire Productions, Aaron Cremation &amp; Burial Svc, Dasher Lawless, Funeraria Del Angel Praiswater, Meyer Mitchell Mortuaries, Socal Cremations, Forest Lawn Memorial-Parks &amp; Mortuaries, Hollywood Hills, and Forest Lawn, Glendale, Mount Sinai Memorial Parks and Mortuaries Los Angeles,Mount Sinai Simi Valley, Rose Family Funeral Home &amp; Cremation Simi Valley, Pierce Brothers Vahlalla Memorial Park North Hollywood, Pierce Brothers Valley Oaks-Griffin Mortuary and Memorial Park Westlake Village, International, Life Story Video </small></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2018-05-10 00:26:20', '2018-08-27 18:12:50', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
