(23, 'Organie About us 2', 'one_column', NULL, NULL, 'organie-about-us-2', NULL, '\no<div class=\"about_us_2\">\n<div class=\"set_bg\">\n<div class=\"about_us_story\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 left\"><img class=\"img-responsive bg_1\" src=\"{{media url=\"wysiwyg/about_us/about-us-story-bg1.png\"}}\" alt=\"\" /> <img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/about_us/about-us-story-1.png\"}}\" alt=\"\" /></div>\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 center\">\n<div class=\"center_inner\">\n<div class=\"title_section\">\n<h2>our story</h2>\n<p>-Discover our beautiful farm-</p>\n</div>\n<div class=\"content_story\">\n<p>We are <span>Online Market</span> of organic fruits, vegetables, juices and dried fruits. Organic farming supports eco-sustenance, or farming in harmony with nature.</p>\n<p>Organic farming produces plant and animal foods without the excessive use of chemicals. It focuses on using fertile soil along with a variety of crops to maintain healthy growing conditions which produce a food with more nutrients and less chemicals than typical commercial foods.</p>\n<p>Visit our site for a complete list of exclusive we are stocking.</p>\n<img class=\"img-responsive col-lg-4 col-md-4 col-sm-4 col-xs-4\" src=\"{{media url=\"wysiwyg/about_us/about-us-signature.png\"}}\" alt=\"\" />\n<h2>jerry hensen</h2>\n<p class=\"h5\"><em>/ Director Organic</em></p>\n</div>\n</div>\n</div>\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 right\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/about_us/about-us-story-2.png\"}}\" alt=\"\" /> <img class=\"img-responsive bg_2\" src=\"{{media url=\"wysiwyg/about_us/about-us-story-bg2.png\"}}\" alt=\"\" /></div>\n</div>\n</div>\n</div>\n<div class=\"about_us_clients\">\n<div class=\"container\">\n<div class=\"row\">{{block type=\"testimonial/testimonial\" template=\"mgs/testimonial/view.phtml\" view_mode=\"list\" title=\"We love our clinets!\" item_count=\"3\"}}</div>\n</div>\n<div class=\"farm_services_brands\">\n<div class=\"container\">\n<div class=\"row\">{{block type=\"brand/homeblock\" brand_ids=\"\" slider=\"1\" title=\"\" count_per_row=\"5\" number_row=\"1\" auto_play=\"false\" stop_hover=\"false\" navigation=\"false\" pagination=\"false\" template=\"mgs/brand/home-featured-brands.phtml\"}}</div>\n</div>\n</div>\n</div>\n<div><img class=\"bg-about-1\" src=\"{{media url=\"wysiwyg/about_us/bg-about-22.png\"}}\" alt=\"alt\" /> <img class=\"bg-about-2\" src=\"{{media url=\"wysiwyg/about_us/bg-about-21.png\"}}\" alt=\"alt\" /></div>\n</div>\n<div class=\"about_us_farmers\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"title_farmers title_section col-lg-12 col-md-12 col-sm-12 col-xs-12\">\n<h2>our farmers</h2>\n<p class=\"h4\"><em>-We are the best team-</em></p>\n</div>\n<div class=\"farmer_items\">\n<div class=\"col-lg-3 col-md-3 col-sm-6 col-xs-12 farmer_item\"><img class=\"img-responsive image_farmer_item\" src=\"{{media url=\"wysiwyg/about_us/farmer1.png\"}}\" alt=\"\" />\n<h2>tyler palmer</h2>\n<p class=\"h5\"><em>Director</em></p>\n</div>\n<div class=\"col-lg-3 col-md-3 col-sm-6 col-xs-12 farmer_item\"><img class=\"img-responsive image_farmer_item\" src=\"{{media url=\"wysiwyg/about_us/farmer2.png\"}}\" alt=\"\" />\n<h2>tyler palmer</h2>\n<p class=\"h5\"><em>Farmer</em></p>\n</div>\n<div class=\"col-lg-3 col-md-3 col-sm-6 col-xs-12 farmer_item\"><img class=\"img-responsive image_farmer_item\" src=\"{{media url=\"wysiwyg/about_us/farmer3.png\"}}\" alt=\"\"/>\n<h2>tyler palmer</h2>\n<p class=\"h5\"><em>Farmer</em></p>\n</div>\n<div class=\"col-lg-3 col-md-3 col-sm-6 col-xs-12 farmer_item\"><img class=\"img-responsive image_farmer_item\" src=\"{{media url=\"wysiwyg/about_us/farmer4.png\"}}\" alt=\"\" />\n<h2>tyler palmer</h2>\n<p class=\"h5\"><em>Farmer</em></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\no', '2018-07-17 08:06:51', '2018-07-17 08:06:51', 1, 0, NULL, 