(24, 'Contact us', 'one_column', NULL, NULL, 'contact', NULL, '<div class=\"row full-width-row\" style=\"position: relative; margin-top: 28px; margin-bottom: 148px;\">\r\n<div class=\"col-md-6 col-md-6-fit-p-h-l\"><img class=\"vertical-center about-right-image\" src=\"../media/vf/Contact_Flowers.png\" style=\"width: 70%;\" /></div>\r\n<div class=\"col-md-6 col-md-offset-6\">\r\n<div class=\"vf-home-bg\">\r\n<h2 class=\"title-block left-title-block\">GET IN TOUCH</h2>\r\n</div>\r\n<p class=\"font-style-3\"><small>Visit us at our store, or get in touch with us by phone or email.</small></p>\r\n<p class=\"font-style-3\"><small>We\'re happy to help you with all your floral arrangement needs!</small></p>\r\n<div class=\"row\" style=\"margin-top: 75px; margin-bottom: 25px;\">\r\n<div class=\"col-md-6\">\r\n<p class=\"font-style-2\">Address</p>\r\n<p>17818 Chatsworth St. Granada Hills CA 91344</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<p class=\"font-style-2\">Phone</p>\r\n<p>(818) 832-7770</p>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<p class=\"font-style-2\">Hours of Operation</p>\r\n<p>Hours of Operation</p>\r\n<p>Mon-Fri: 9:00am to 5:00pm</p>\r\n<p>Saturday: 9:00am to 3:00pm</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<p class=\"font-style-2\">Email</p>\r\n<p>Vincablooms@gmail.com</p>\r\n<p>michael@villagefloristla.com</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>{{block type=\"core/template\" name=\"contactForm\" form_action=\"/contacts/index/post\" template=\"contacts/form_2.phtml\"}}</p>', '2018-07-17 08:06:51', '2018-08-27 18:11:31', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'Organie 404 Not Found', 'one_column', NULL, NULL, 'organie-no-route', NULL, '\no<div class=\"center container\">\n<h3>Opps! Page not found!</h3>\n<span>Please go back to</span> <a href=\"{{store url=\"\"}}\">Home page</a>\n<div class=\"img\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/img-404.png\"}}\" alt=\"\" /></div>\n</div>\no', '2018-07-17 08:06:51', '2018-07-17 08:06:51', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
