(26, 'About us', 'one_column', NULL, NULL, 'about-us-cake', NULL, '\no<div class=\"cake_about\">\n<div class=\"top container\">\n<div class=\"row\">\n<div class=\"left col-md-7 col-sm-12\">\n<div class=\"title\">\n<h3>#Welcome</h3>\n<h3>to organie</h3>\n<h5><em>-The best services for you-</em></h5>\n</div>\n<p>We invite you to enjoy our bakery\'s deliciously sweet cakes and breads made every day specifically for you.</p>\n<img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake-about-2.png\"}}\" alt=\"organie\" /></div>\n<div class=\"right col-md-5 col-sm-12\">\n<div class=\"border\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake-about.jpg\"}}\" alt=\"organie\" /></div>\n<div class=\"content clearfix\">\n<h5 class=\"desc\"><em>Organie store is the greatest online health food shop. I&rsquo;m always going to be one.</em></h5>\n<strong class=\"text-uppercase client\">Jenry Hansen</strong>\n<h5 class=\"client\"><em>/Student-USA</em></h5>\n</div>\n</div>\n</div>\n</div>\n<div class=\"bottom container\">\n<div class=\"row\">\n<div class=\"col-md-6 col-sm-12\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_director.jpg\"}}\" alt=\"organie\" /></div>\n<div class=\"col-md-6 col-sm-12 text-center right\">\n<div class=\"title\">\n<h5><em>-Director store-</em></h5>\n<h3>#Meghan trainor</h3>\n</div>\n<p>Cur tantas regiones barbarorum peat dibus obiit, tot mariata uisque euismod convallis eros quis lacinia ur tantas regiones barbarorum peat dibus obiit, tot mariata uisque euismod convallis erostas regiones barbarorum peat dibus obiit, tot mariata uisque euslf</p>\n<div class=\"block-social\">\n<ul>\n<li><a href=\"#\"><em class=\"ion-social-facebook\">&nbsp;</em></a></li>\n<li><a href=\"#\"><em class=\"ion-social-twitter\">&nbsp;</em></a></li>\n<li><a href=\"#\"><em class=\"ion-social-youtube\">&nbsp;</em></a></li>\n<li><a href=\"#\"><em class=\"ion-social-vimeo\">&nbsp;</em></a></li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n<div class=\"cake_statistic container text-center\">\n<ul>\n<li class=\"col-sm-3 col-xs-6\">\n<h3>27</h3>\n<strong>Year of experience</strong></li>\n<li class=\"col-sm-3 col-xs-6\">\n<h3>140+</h3>\n<strong>Happy clients</strong></li>\n<li class=\"col-sm-3 col-xs-6\">\n<h3>35</h3>\n<strong>Templates</strong></li>\n<li class=\"col-sm-3 col-xs-6\">\n<h3>940+</h3>\n<strong>Coffee cups</strong></li>\n</ul>\n</div>\n</div>\n<div class=\"cake_instagram container\">\n<div class=\"row\">\n<div class=\"text center\">\n<p>Follow us on</p>\n<strong>Instagram</strong>\n<h5><em>@organie_store941</em></h5>\n</div>\n<div class=\"left col-xs-6\"><a href=\"https://www.instagram.com/p/BRnMu1fhrC_/\" target=\"_blank\"> <img class=\"img-1 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_5_.jpg\"}}\" alt=\"organie\" /> </a> <a href=\"https://www.instagram.com/p/BRnMs-2BZyi/\" target=\"_blank\"> <img class=\"img-2 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_4_.jpg\"}}\" alt=\"organie\" /> </a> <a href=\"https://www.instagram.com/p/BRnMstUh9Rg/\" target=\"_blank\"> <img class=\"img-3 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_3_.jpg\"}}\" alt=\"organie\" /> </a></div>\n<div class=\"right col-xs-6\"><a href=\"https://www.instagram.com/p/BRnMqa5BmjK/\" target=\"_blank\"> <img class=\"img-4 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_2_.jpg\"}}\" alt=\"organie\" /> </a> <a href=\"https://www.instagram.com/p/BRnMpbKhXYX/\" target=\"_blank\"> <img class=\"img-5 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_1_.jpg\"}}\" alt=\"organie\" /> </a> <a href=\"https://www.instagram.com/p/BRnMmebhw6u/\" target=\"_blank\"> <img class=\"img-6 img-responsive\" src=\"{{media url=\"wysiwyg/cake/cake_instagram_6_.jpg\"}}\" alt=\"organie\" /> </a></div>\n</div>\n</div>\no', '2018-07-17 08:06:51', '2018-07-17 08:06:51', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'Reward Policy', 'two_columns_left', 'reward policy', 'reward policy', 'rewardpoints-policy', 'Reward Policy', '<div>\n    {{block type=\"rewardpoints/template\" template=\"rewardpoints/policy/earn.phtml\" }}\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} EXCHANGE RATES</strong>\n        <br>\n        <p class=\"rewardpoints-title-content\">The value of {{block type=\"rewardpoints/welcome_name\"}} is determined by an exchange rate of both currency spent on products to {{block type=\"rewardpoints/welcome_name\"}}, and an exchange rate of {{block type=\"rewardpoints/welcome_name\"}} earned to currency for spending on future purchases.</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">REDEEM {{block type=\"rewardpoints/welcome_name\"}}</strong>\n        <br>\n        <p class=\"rewardpoints-title-content\">You can redeem your {{block type=\"rewardpoints/welcome_name\"}} at checkout. If you have accumulated enough {{block type=\"rewardpoints/welcome_name\"}} to redeem them you will have the option of using {{block type=\"rewardpoints/welcome_name\"}} as one of the payment methods. The option to use {{block type=\"rewardpoints/welcome_name\"}}, as well as your balance and the monetary equivalent this balance, will be shown to you in the Payment Method area of the checkout. Redeemable {{block type=\"rewardpoints/welcome_name\"}} can be used in conjunction with other payment methods such as credit cards, gift cards and more.</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} MINIMUMS AND MAXIMUMS</strong>\n        <p class=\"rewardpoints-title-content\">{{block type=\"rewardpoints/welcome_name\"}} may be capped at a minimum value required for redemption. If this option is selected you will not be able to use your {{block type=\"rewardpoints/welcome_name\"}} until you accrue a minimum number of {{block type=\"rewardpoints/welcome_name\"}}, at which {{config path=\"rewardpoints/general/point_name\"}} they will become available for redemption.\n</br>{{block type=\"rewardpoints/welcome_name\"}} may also be capped at the maximum value of {{block type=\"rewardpoints/welcome_name\"}} which can be accrued. If this option is selected you will need to redeem your accrued {{block type=\"rewardpoints/welcome_name\"}} before you are able to earn more {{block type=\"rewardpoints/welcome_name\"}}.\n</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">MANAGE YOUR {{block type=\"rewardpoints/welcome_name\"}}</strong>\n        <p class=\"rewardpoints-title-content\">You have the ability to view and manage your {{block type=\"rewardpoints/welcome_name\"}} through your <a href=\"\">Customer Account</a>. From your account you will be able to view your total {{block type=\"rewardpoints/welcome_name\"}} (and currency equivalent), minimum needed to redeem, whether you have reached the maximum {{block type=\"rewardpoints/welcome_name\"}} limit and a cumulative history of {{block type=\"rewardpoints/welcome_name\"}} acquired, redeemed and lost. The history record will retain and display historical rates and currency for informational purposes. The history will also show you comprehensive informational messages regarding {{block type=\"rewardpoints/welcome_name\"}}, including expiration notifications.\n</p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title\">{{block type=\"rewardpoints/welcome_name\"}} EXPIRATION</strong>\n        <p class=\"rewardpoints-title-content\">{{block type=\"rewardpoints/welcome_name\"}} can be set to expire. Points will expire in the order form which they were first earned.</p>\n        <strong>Note:</strong>\n        <ul class=\"rewardpoints-dashboard-ul\">\n            <li>Points can be used as store credit in our system only. Redeeming to cash is not allowed.</li>\n            <li>You can sign up to receive email notifications each time your balance changes when you either earn, redeem or lose {{block type=\"rewardpoints/welcome_name\"}}, as well as point expiration notifications. This option is found in the {{block type=\"rewardpoints/welcome_name\"}} section of the My Account area.</li>\n        </ul>\n    </div>\n</div>\n\n', '2018-08-11 23:46:50', '2018-08-11 23:46:50', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 'Reward Welcome Page', 'two_columns_left', 'reward welcome page', 'reward welcome page', 'rewardpoints-welcome', 'WELCOME TO OUR REWARD PROGRAM!', '<div>\n    <div class=\"rewardpoints-dashboard-list\">\n        Every of your activity on our site is appreciated & rewarded. The more you spend, the more you save. Enroll now to begin earning greater benefits! \n        If you are already a member, log in to view your Reward Balance.\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        <strong class=\"rewardpoints-title rewardpoints-title-upercase\">BENEFITS OF {{block type=\"rewardpoints/welcome_name\"}} FOR REGISTERED CUSTOMERS</strong>\n        <p class=\"rewardpoints-title-content\"><img src=\"{{media url=\"rewardpoints/default/welcome.png\"}}\" alt=\"{{block type=\"rewardpoints/welcome_name\"}} Welcome\" /></p>\n\n        <p class=\"rewardpoints-title-content\">\n            Once you register you will be able to earn and accrue {{block type=\"rewardpoints/welcome_name\"}}, which are then redeemable at time of purchase towards the cost of your order. Rewards are an added bonus to your shopping experience on the site and just one of the ways we thank you for being a loyal customer. You can easily earn points for certain actions you take on the site, such as making purchases.\n        </p>\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        {{block type=\"rewardpoints/account_dashboard_earn\" template=\"rewardpoints/account/dashboard/earn.phtml\"}}\n        {{block type=\"rewardpointsrule/account_dashboard_earn\" template=\"rewardpointsrule/account/dashboard/earn.phtml\"}}\n    </div>\n    <div class=\"rewardpoints-dashboard-list\">\n        {{block type=\"rewardpoints/account_dashboard_spend\" template=\"rewardpoints/account/dashboard/spend.phtml\"}}\n        {{block type=\"rewardpointsrule/account_dashboard_spend\" template=\"rewardpointsrule/account/dashboard/spend.phtml\"}}\n    </div>\n</div>', '2018-08-11 23:46:50', '2018-08-11 23:46:50', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 'Blog Detail', 'one_column', NULL, NULL, 'blog-detail', NULL, '<p>To be updated regularly by VF</p>', '2018-08-26 18:39:01', '2018-09-04 17:41:59', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'Custom arrangement', 'one_column', NULL, NULL, 'custom-arrangement', NULL, '<div class=\"row full-width-row\" style=\"position: relative; margin-top: 28px; margin-bottom: 60px;\">\r\n<div class=\"title-block vf-home-bg\">\r\n<h2 style=\"margin: 50px auto;\">Design your custom arrangement</h2>\r\n<p class=\"font-style-3\">Tell us your needs.</p>\r\n<p class=\"font-style-3\">We\'ll customize your bouquet with our freshest flowers!</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"row full-width-row\" style=\"position: relative; margin-top: 28px; margin-bottom: 148px;\">\r\n<div class=\"col-md-6 col-md-6-fit-p-h-l\"><img class=\"vertical-center about-right-image\" src=\"../media/vf/CustomArrangement_BouquetImage.png\" style=\"width: 90%;\" />\r\n</div>\r\n<div class=\"col-md-6 col-md-offset-6\">\r\n<p>DELIVERY DATE</p>\r\n<input type=\"text\" name=\"delivery_date\" id=\"delivery_date\">\r\n<script>\r\n$(function() {\r\n$( \"#delivery_date\" ).datepicker();\r\n});\r\n</script>\r\n<p>Occasion</p>\r\n<div class=\"field\">\r\n<select name=\"occasion\" id=\"occasion\" class=\"input-text form-control\"/>\r\n<option disabled=\"\" selected=\"\">Select an occasion</option>\r\n                                            <option value=\"Administrative Professionals\' Week\">Administrative Professionals\' Week</option>\r\n                                            <option value=\"Anniversary\">Anniversary</option>\r\n                                            <option value=\"Autumn\">Autumn</option>\r\n                                            <option value=\"Best Friends Day\">Best Friends Day</option>\r\n                                            <option value=\"Birthday\">Birthday</option>\r\n                                            <option value=\"Boss\'s Day \">Boss\'s Day </option>\r\n                                            <option value=\"Breast Cancer Awareness Month\">Breast Cancer Awareness Month</option>\r\n                                            <option value=\"Christmas\">Christmas</option>\r\n                                            <option value=\"Cinco De Mayo\">Cinco De Mayo</option>\r\n                                            <option value=\"Congrats\">Congrats</option>\r\n                                            <option value=\"Earth Day\">Earth Day</option>\r\n                                            <option value=\"Easter and Passover\">Easter and Passover</option>\r\n                                            <option value=\"Father\'s Day\">Father\'s Day</option>\r\n                                            <option value=\"Get Well\">Get Well</option>\r\n                                            <option value=\"Gift Sets\">Gift Sets</option>\r\n                                            <option value=\"Graduation\">Graduation</option>\r\n                                            <option value=\"Grandparent\'s Day\">Grandparent\'s Day</option>\r\n                                            <option value=\"Halloween\">Halloween</option>\r\n                                            <option value=\"Hanukkah\">Hanukkah</option>\r\n                                            <option value=\"Holiday\">Holiday</option>\r\n                                            <option value=\"I\'m Sorry\">I\'m Sorry</option>\r\n                                            <option value=\"Just Because\">Just Because</option>\r\n                                            <option value=\"Labor Day \">Labor Day </option>\r\n                                            <option value=\"Love and Romance\">Love and Romance</option>\r\n                                            <option value=\"Mother\'s Day\">Mother\'s Day</option>\r\n                                            <option value=\"New Baby\">New Baby</option>\r\n                                            <option value=\"New Year\">New Year</option>\r\n                                            <option value=\"Parent\'s Day\">Parent\'s Day</option>\r\n                                            <option value=\"Patriotic Day\">Patriotic Day</option>\r\n                                            <option value=\"Persian New Year\">Persian New Year</option>\r\n                                            <option value=\"Prom\">Prom</option>\r\n                                            <option value=\"Rosh Hashanah\">Rosh Hashanah</option>\r\n                                            <option value=\"Spring\">Spring</option>\r\n                                            <option value=\"St. Patrick\'s Day\">St. Patrick\'s Day</option>\r\n                                            <option value=\"Summer\">Summer</option>\r\n                                            <option value=\"Sympathy and Funeral\">Sympathy and Funeral</option>\r\n                                            <option value=\"Thank You\">Thank You</option>\r\n                                            <option value=\"Thanksgiving\">Thanksgiving</option>\r\n                                            <option value=\"Valentine\'s Day\">Valentine\'s Day</option>\r\n                                            <option value=\"Wedding\">Wedding</option>\r\n                                            <option value=\"Winter\">Winter</option>\r\n                                            <option value=\"Women\'s Day\">Women\'s Day</option>\r\n</select>\r\n</div>\r\n<p>RECIPIENT</p>\r\n<div class=\"field\">\r\n<select name=\"recipient\" id=\"recipient\" class=\"input-text form-control\"/>\r\n<option disabled=\"\" selected=\"\">Select a recipient type</option>\r\n<option>Girlfriend, Fiancé or Wife</option>\r\n<option>Mother</option>\r\n<option>Grandmother</option>\r\n<option>Daughter</option>\r\n<option>Father or Grandfather</option>\r\n<option>Boyfriend, Fiancé or Husband</option>\r\n<option>Co-Worker</option>\r\n<option>Young Girl</option>\r\n<option>Young Boy</option>\r\n<option>Other</option>\r\n</select>\r\n</div>\r\n<p>SIZE</p>\r\n<div class=